import Trail from "./p/[id]";

const Books = (props) => {
    return(
        <div>
            {props.books.map((book) => (
                <li key={book.primary_isbn13}>
                    <Link href="/books/[id]" as={`/books/${book.primary_isbn13}`}>
                        <a>{book.title}</a>
                    </Link>
                </li>
            ))}
        </div>
    )
}

Books.getInitialProps = async function() {
    const res = await fetch(`https://api.nytimes.com/svc/books/v3/lists/best-sellers/history.json?api-key=FKUX6ohX3FTf4TmzHnlcnZIZMApf0iCc`)
    const data = await res.json();

    console.log(`Show data fetched. Count: ${data.length}`);
    return {
        books : data.results
    }
}

export default Books;
